import './index.css';

class App extends React.Component{

    render(){
        return (
            <div className="container">
                <div className="px-5">
                <input
            //   value={name}
                onChange={this.handleChange}
                type="text"
                name="name"
                className="form-control w-40"
              id="InputName"
              aria-describedby="nameHelp"
              placeholder="Enter Name"
            />
            </div>
            </div>
        )
    }
}
export default App;
